import React from 'react';
import './Logo.css';
import Media from 'react-media';
import { TweenMax, Expo } from 'gsap';

// Logo view 
export default function RetuRnLogo() {
 return (
  <Media
   queries={{
    small: '(max-width: 599px)',
    medium: '(min-width: 600px) and (max-width:1199px)',
    large: '(min-width: 1200px)',
   }}>
   {matches => (
    <>
     {matches.small && <ScreenSmall />}
     {matches.medium && <ScreenLarge />}
     {matches.large && <ScreenLarge />}
    </>
   )}
  </Media>
 )
};

export const ScreenLarge = () => (
 <div className='wrp-add-money-logo'>
  <ViewIMG />
 </div>
);
export const ScreenSmall = () => (
 <div className='wrp-add-money-logo-sm'>
  <ViewIMG />
 </div>
);
export const ViewIMG = () => {

 React.useEffect(() => {
  TweenMax.from('.wrp-img-view img', 1.2, { delay: 1.2, opacity: 0, y: 10, ease: Expo.easeIn });

 }, []);

 return (
  <div className='wrp-img-view'>
   <img src={'/img/logo.png'} alt={'img logo home admin'} />
  </div>
 );
};
